class Solution {
public:
  int checkRepeat(string s){
    char c=*(s.end()-1); 
    for(string::iterator it=s.begin(); it!=(s.end()-1); ++it){
      if(c==*it) return (it-s.begin()+1); 
    }
    return 0; 
  }
  int lengthOfLongestSubstring(string s) {
    int max=0, shift=0; 
    for(string::iterator it=s.begin(); it!=s.end(); ++it){
      for(string::iterator it2=it; it2!=s.end(); ++it2){
        string tmp(it, it2+1);
        if((shift=checkRepeat(tmp))==0){
          if(max<tmp.size()){
            max=tmp.size();
          }
        }else{
          if(shift==1){
            int match=1; 
	    int pos=0; 
            for(string::iterator it3=(it+tmp.size()-1);it3!=(it+tmp.size()+tmp.size()-2);++it3){
	      if(*it3!=tmp[pos]){
		match=0; 
		break; 
	      }
              pos++; 
	    }
	    if(match==1) shift=tmp.size()-1;
	  }
          it=it+shift-1; 
	  break; 
	}
      }
      if(shift==0) break; 
    }
    return max;
  }
};

